import React, {lazy} from "react";
import { Routes, Route } from "react-router-dom";

const HomePage = lazy()

const App = () => {
  return (
  <Routes>
    <Route path="/" element={<HomePage/>}/>
    <Route path="/about" element={<AboutPage/>}/>
    <Route path="/contacts" element={<ContactsPage/>}/>
  </Routes>
  )
};

export default App;
